import React from "react";
import NavBanner from "./NavBanner";
import CarouselBanner from './Carousel';
import ToolBar from "./ToolBar";
import PlaceholderPost from "./Placeholderpost";


function App(){
    return(
        <>
            <NavBanner/>
            <CarouselBanner/>
            <ToolBar/>
            <PlaceholderPost/>
            <PlaceholderPost/>
            <PlaceholderPost/>
            <PlaceholderPost/>
            <PlaceholderPost/>
            <PlaceholderPost/>
            <PlaceholderPost/>
        </>
    )
}

export default App;
